import React from "react"
import Dashboard from "./Components/Dashboard"
import {CSSTransition, TransitionGroup} from "react-transition-group"
import Login from "./Components/Login"
import "./CSS/App.css"

function App () {
  const [whichPage, setWhichPage] = React.useState("Login")


  const renderPage = () => {
    switch (whichPage){
      case "Dashboard":
        return <Dashboard setWhichPage = {setWhichPage}/>
      case "Login":
        return <Login setWhichPage = {setWhichPage}/>
      default:
        return <Login setWhichPage = {setWhichPage}/>
    }
  }

  return (
    <div className="App">
      <TransitionGroup>
        <CSSTransition
                in={setWhichPage==="Login"}
                timeout={300}
                classNames="alert"
                unmountOnExit
        >
          <Login setWhichPage={setWhichPage}/>
        </CSSTransition>
        <CSSTransition
                in={setWhichPage==="Dashboard"}
                timeout={300}
                classNames="alert"
                unmountOnExit
          >
          <Dashboard setWhichPage={setWhichPage}/>
        </CSSTransition>
      </TransitionGroup>
    </div>
  );
}

export default App;
